import React, { useContext, useState } from 'react';
import { StateContext } from '../pages/sokpage';
import { Appstate } from '../types/domain';

function OppsummeringEnhetsregister() {
    const state = useContext<Appstate>(StateContext);
    const [visMer, setVisMer] = useState(false);

    if (!state.enhetsregisterResult) {
        return null;
    }

    const [enhet] = state.enhetsregisterResult.enheter;
    return (
        <div className="oppsummering">
            <h3>{enhet.navn} ({enhet.organisasjonsform.beskrivelse})</h3>
            <p>{enhet.registrertIMvaregisteret ? "Er i MVA-registeret! ✅" : "Er ikke i MVA-registeret"}</p>
        </div>
    )
}

export default OppsummeringEnhetsregister;
